-- ----------------------------
-- Table structure for os_ly_apply
-- ----------------------------
DROP TABLE IF EXISTS `os_ly_apply`;
CREATE TABLE `os_ly_apply` (
  `APPLY_ID` varchar(40) NOT NULL COMMENT '主键',
  `APPLY_CODE` varchar(40) DEFAULT NULL COMMENT '编号',
  `APPLY_TITLE` varchar(200) DEFAULT NULL COMMENT '标题',
  `APPLY_DESC` varchar(400) DEFAULT NULL COMMENT '说明',
  `S_WF_INST` varchar(40) DEFAULT NULL COMMENT '流程实例',
  `S_WF_NODE` varchar(2000) DEFAULT NULL COMMENT '流程节点',
  `S_WF_USER` varchar(2000) DEFAULT NULL COMMENT '流程流转用户',
  `S_WF_STATE` int(4) DEFAULT NULL COMMENT '流程状态',
  `S_FLAG` int(4) DEFAULT NULL COMMENT '表单状态',
  `S_USER` varchar(40) DEFAULT NULL COMMENT '拟稿人',
  `S_DEPT` varchar(40) DEFAULT NULL COMMENT '申请部门',
  `S_TDEPT` varchar(40) DEFAULT NULL COMMENT '有效部门',
  `S_ODEPT` varchar(40) DEFAULT NULL COMMENT '申请机构',
  `S_CMPY` varchar(40) DEFAULT NULL COMMENT '公司',
  `S_ATIME` varchar(40) DEFAULT NULL COMMENT '创建时间',
  `S_MTIME` varchar(40) DEFAULT NULL COMMENT '修改时间',
  `S_YYYYMMDD` varchar(40) DEFAULT NULL COMMENT '日期',
  PRIMARY KEY (`APPLY_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='办公用品领用申请单';

-- ----------------------------
-- Records of os_ly_apply
-- ----------------------------

