  `SRC_SERV_CODE` varchar(40) DEFAULT NULL COMMENT '主服务code',
  `SERV_CODE` varchar(40) DEFAULT NULL COMMENT '服务ID',
  `ITEM_CODE` varchar(1000) DEFAULT NULL COMMENT '字段ID，超长是因为要存等价服务串的原因',
