  `S_WF_USER` varchar(2000) DEFAULT NULL COMMENT '办理用户',
  `S_WF_NODE` varchar(2000) DEFAULT NULL COMMENT '办理节点',
  `S_WF_STATE` decimal(4,0) DEFAULT NULL COMMENT '流转状态',
