CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `sy_serv_log_item_v` AS select `a`.`ILOG_ID` AS `ILOG_ID`,`a`.`ITEM_ID` AS `ITEM_ID`,`a`.`ITEM_CODE` AS `ITEM_CODE`,`a`.`DATA_ID` AS `DATA_ID`,`a`.`ILOG_OLD` AS `ILOG_OLD`,`a`.`ILOG_NEW` AS `ILOG_NEW`,`a`.`S_CMPY` AS `S_CMPY`,`a`.`S_USER` AS `S_USER`,`a`.`S_MTIME` AS `S_MTIME`,`a`.`ILOG_IP` AS `ILOG_IP`,`a`.`SERV_ID` AS `serv_id`,`b`.`ITEM_NAME` AS `item_name`,`b`.`ITEM_INPUT_TYPE` AS `item_input_type`,`b`.`ITEM_INPUT_MODE` AS `item_input_mode`,`b`.`DICT_ID` AS `dict_id` from (`sy_serv_log_item` `a` left join `sy_serv_item` `b` on((`a`.`ITEM_ID` = `b`.`ITEM_ID`))) ;

