-- View structure for sy_wfe_remind_v
-- ----------------------------
DROP VIEW IF EXISTS `sy_wfe_remind_v`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `sy_wfe_remind_v` AS select `a`.`REMD_ID` AS `REMD_ID`,`a`.`ACPT_USER` AS `ACPT_USER`,`a`.`ACPT_DEPT` AS `ACPT_DEPT`,`a`.`ACPT_TDEPT` AS `ACPT_TDEPT`,`a`.`ACPT_PHONE` AS `ACPT_PHONE`,`a`.`REMD_TITLE` AS `REMD_TITLE`,`a`.`REMD_REASON` AS `REMD_REASON`,`a`.`REMD_CODE` AS `REMD_CODE`,`a`.`REMD_YEAR` AS `REMD_YEAR`,`a`.`REMD_NUM` AS `REMD_NUM`,`a`.`REMD_CDEPT` AS `REMD_CDEPT`,`a`.`DEADLINE` AS `DEADLINE`,`a`.`OVER_DAYS` AS `OVER_DAYS`,`a`.`S_EMERGENCY` AS `S_EMERGENCY`,`a`.`DO_MIND` AS `DO_MIND`,`a`.`REMD_PHONE` AS `REMD_PHONE`,`a`.`REMD_STATUS` AS `REMD_STATUS`,`a`.`S_FLAG` AS `S_FLAG`,`a`.`S_USER` AS `S_USER`,`a`.`S_DEPT` AS `S_DEPT`,`a`.`S_TDEPT` AS `S_TDEPT`,`a`.`S_ODEPT` AS `S_ODEPT`,`a`.`S_CMPY` AS `S_CMPY`,`a`.`S_ATIME` AS `S_ATIME`,`a`.`S_MTIME` AS `S_MTIME`,`a`.`REMD_SCRT` AS `REMD_SCRT`,`a`.`SERV_ID` AS `SERV_ID`,`a`.`DATA_ID` AS `DATA_ID`,`a`.`WF_NODE_ID` AS `WF_NODE_ID`,`a`.`ACPT_USER_NAME` AS `ACPT_USER_NAME`,`b`.`USER_NAME` AS `USER_NAME`,`c`.`DEPT_NAME` AS `DEPT_NAME` from ((`sy_wfe_remind` `a` left join `sy_org_user` `b` on((`a`.`ACPT_USER` = `b`.`USER_CODE`))) left join `sy_org_dept` `c` on((`a`.`ACPT_DEPT` = `c`.`DEPT_CODE`))) ;

