CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `ts_buy_apply_detail_v` AS select `a`.`DT_ID` AS `DT_ID`,`a`.`AP_ID` AS `AP_ID`,`a`.`ITEM_ID` AS `ITEM_ID`,`a`.`ITEM_NAME` AS `ITEM_NAME`,`a`.`ITEM_CODE` AS `ITEM_CODE`,`a`.`ITEM_CATEGORY` AS `ITEM_CATEGORY`,`a`.`ITEM_PRICE` AS `ITEM_PRICE`,`a`.`DT_COUNT` AS `DT_COUNT`,`a`.`DT_AMOUNT` AS `DT_AMOUNT` from ((`ts_buy_apply_detail` `a` join `ts_buy_item` `b`) join `ts_buy_apply` `c`) where ((`a`.`ITEM_ID` = `b`.`ITEM_ID`) and (`a`.`AP_ID` = `c`.`AP_ID`)) ;
